import { Link } from "react-router-dom";

const Ham_Submenu = ({ title, items }) => {
  return (
    <>
      <h4 className="w-20 mx-auto translate-y-[-45px] h-0 text-center">
        {title}
      </h4>
      {items.products?.map((item, index) => {
        return (
          <>
            <div className="w-3/4 grid grid-cols-4 gap-3 px-12">
              {prods?.map((item, index) => {
                return (
                  <div key={index} className="text-center">
                    <div className="flex justify-center">
                      <Link to={item.links[0].to}>
                        <img
                          src={item.cover}
                          alt={item.title}
                          className="h-[100px]"
                        />
                      </Link>
                    </div>
                    <h4 className="font-bold">{item.title}</h4>
                    <p className="text-xs mt-2">
                      {item.links.map((link, index) => {
                        return (
                          <Link
                            to={link.to}
                            key={index}
                            className={`link ${index != 0 && "ms-1"}`}
                          >
                            {link.label}
                          </Link>
                        );
                      })}
                    </p>
                  </div>
                );
              })}
            </div>
            <div className="w-1/4 flex flex-col justify-center">
              <ul className="border-s ps-16 py-5 text-xs h-full font-bold">
                {links.map((link, index) => (
                  <li key={index} className="py-1">
                    <Link
                      to={link.to}
                      className="hover:underline hover:decoration-2"
                    >
                      {link.label}
                    </Link>
                  </li>
                ))}
              </ul>
            </div>
          </>
        );
      })}
      <ul className="flex flex-col gap-4">
        {items.links.map((item, index) => {
          return (
            <li key={index}>
              <Link to="/" className="block navitem py-4">
                <span>{item.label}</span>
              </Link>
            </li>
          );
        })}
      </ul>
    </>
  );
};

export default Ham_Submenu;
